import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({contacts}) => {
  return (
    <div>
    {tiles.map((contact, index) => {
        const {name, ...description } = contact;
        return <Tile key={index} name={name} description={description}/>
    })} 
    </div>
  );
};
